import React, { Component } from 'react';
import { Link } from "react-router-dom";



class Navbar extends Component {
    constructor(props){
        super(props);
        const auth = sessionStorage.getItem('userAuth');
        if(auth !== 'Success'){
            this.state = {
                navitems:[
                    {
                        id: 1,
                        hash: "home",
                        name: "Home",
                        path : "/"
                    },
                    {
                        id: 2,
                        hash: "login",
                        name: "Login",
                        path : "/login"
                    },
                    {
                        id: 3,
                        hash: "signup",
                        name: "Signup",
                        path : "/signup"
                    },
                    {
                        id: 4,
                        hash: "Profile",
                        name: "Profile",
                        url : "/profile"
                    }, 
                    {
                        id: 5,
                        name: "Logout",
                        url : "/logout"
                    },
                ]
            }
        } else {
            this.state = {
                navitems:[
                    {
                        id: 1,
                        name: "Home",
                        url : "/"
                    },
                ]
            } 
        }
    }
    render() {
        return this.state.navitems.map( nav => {
            return(
                <div>
                    <ul>
                        <li key={nav.id} className="item-card">
                            <Link to={nav.url}>{nav.name}</Link>
                        </li>
                    </ul>
              </div>
              );
          }
        )
    };
}

export default Navbar;
